syntax = "proto2";

package MMPro.micromsg;

import "BaseRequest.proto";
import "SKBuiltinBuffer_t.proto";

message NewInitRequest {
	required BaseRequest _BaseRequest = 1;
	optional string _UserName = 2;
	required SKBuiltinBuffer_t _CurrentSynckey = 3;
	required SKBuiltinBuffer_t _MaxSynckey = 4;
	optional string _Language = 5;
}
